import './App.css';
import Nav from './nav';
import Footer from './Footer';
import Register from './register';
import { BrowserRouter,Routes,Route } from 'react-router-dom';

function App() {
  return (
    <div className='App'>
      <BrowserRouter>
        <Nav />
        <Routes>
          <Route path='/' element={<Register/>}></Route>
          <Route path='/login' element={<h1>Login page</h1>}></Route>
          <Route path='/joinForFree' element={<h1>Join for Free page</h1>}></Route>
        </Routes>
      </BrowserRouter>
      <Footer/>
    </div>
  );
}

export default App;
